### Problem11
Look at the following two pieces of code:

Code A:

```java
public class A
{
    public static void main(String[] args) 
    {
        StdOut.print(5+" ");
        StdOut.print(7+" ");
    }

}
```

Code B:

```java
public class B
{
    public static void main(String[]args)
    {
        int x =StdIn.readInt();
        StdOut.println(x);
    }
}
```

What will be the output if we do

java A | java B

**Choices:**

a. There will be an exception 

b. 5

c. 7

d. 5 7

e. nothing
